import { renderDescription } from '../utils/renderDescription';

function WorkEntry({ entry }) {
  return (
    <li>
      <sup>{entry.year}</sup>
      {entry.company} — <i>{entry.role}</i>
      {entry.description && (
        <> — {renderDescription(entry)}</>
      )}
    </li>
  );
}

export default WorkEntry;
